import React, { useEffect } from 'react'
import { getUser } from "./service/AuthService"

const Friends = () => {
    const user = getUser();
    useEffect(() => {
        if (!user) {
            navigate("/login")
        }
    }, [user])
    return (
        <div>
            <div>My Connections</div>
            <div>Sent</div>
            <div>Received</div>
        </div>
    )
}

export default Friends
